func TestUnmarshalSSLGetCert(t *testing.T) {
	t.Log("Testing ssl get cert parser for different firmware versions")

	for _, test := range sslCertFirmwareTests {
		var s SSLGetCertMeasurement
		UnmarshalSSLGetCert([]byte(test.json), test.fw, &s)
		j, _ := json.Marshal(s)

		if test.json != string(j) {
			t.Logf("Error parsing version %d\n", test.fw)
			t.Log("Expected: ", test.json)
			t.Log("Got:      ", string(j))
			t.Fail()
		} else {
			t.Logf("\tVersion %d %s\n", test.fw, checkMark)
		}
	}
}
